import React from "react";
import SingleSong from "../components/SingleSong";
import gql from "graphql-tag";

const SINGLE_SONG_QUERY = gql`
  query SINGLE_SONG_QUERY($id: ID!) {
    song(where: { id: $id }) {
      id
      title
      composer
      publisher
      publishedDate
      altTitle
      instrumental
      fromFilm
      tribute
      artists
      albums
      recordings
    }
  }
`;

const Song = () => {
  return <SingleSong />;
};

export default Song;
